import React, { useEffect, useState, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import { jwtDecode } from 'jwt-decode';
import API from '../api';

export default function DashboardPage() {
  const [tenantInfo, setTenantInfo] = useState(null);
  const [overview, setOverview] = useState(null);
  const [eventSummary, setEventSummary] = useState(null);
  const [topCustomers, setTopCustomers] = useState([]);
  const [orders, setOrders] = useState([]);
  const [customerHistory, setCustomerHistory] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);
  const [ingesting, setIngesting] = useState(false);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');

  const navigate = useNavigate();

  const handleLogout = useCallback(() => {
    localStorage.removeItem('token');
    navigate('/login');
  }, [navigate]);

  const fetchData = useCallback(async () => {
    try {
      setLoading(true);
      const tenantInfoRes = await API.get('/dashboard/tenant-info');
      const overviewRes = await API.get('/dashboard/overview');
      const eventSummaryRes = await API.get('/dashboard/events-summary');
      const topCustomersRes = await API.get('/dashboard/top-customers');
      const ordersRes = await API.get('/dashboard/orders');
      const customerHistoryRes = await API.get('/dashboard/customer-products');

      setTenantInfo(tenantInfoRes.data);
      setOverview(overviewRes.data);
      setEventSummary(eventSummaryRes.data);
      setTopCustomers(topCustomersRes.data.top);
      setOrders(ordersRes.data.orders);
      setCustomerHistory(customerHistoryRes.data);
      setError('');
    } catch (err) {
      setError('Failed to fetch dashboard data.');
      if (err.response?.status === 401) handleLogout();
    } finally {
      setLoading(false);
    }
  }, [handleLogout]);

  useEffect(() => {
    fetchData();
  }, [fetchData]);

  // --- MODIFIED: Added 10+ sample data points ---
  const handleIngestData = async () => {
    try {
      setIngesting(true);
      setError('');
      const token = localStorage.getItem('token');
      const { tenantId } = jwtDecode(token);

      // 1. Ingest Products
      await API.post(`/ingest/tenant/${tenantId}/products`, [
        { "id": 101, "title": "Classic T-Shirt", "price": "25.00" },
        { "id": 102, "title": "Denim Jeans", "price": "75.00" },
        { "id": 103, "title": "Leather Belt", "price": "35.00" },
        { "id": 104, "title": "Sunglasses", "price": "55.00" },
        { "id": 105, "title": "Cozy Hoodie", "price": "60.00" },
        { "id": 106, "title": "Knit Beanie", "price": "20.00" },
      ]);

      // 2. Ingest Customers
      await API.post(`/ingest/tenant/${tenantId}/customers`, [
        { "id": 201, "first_name": "Alice", "last_name": "Johnson", "email": "alice.j@example.com" },
        { "id": 202, "first_name": "Bob", "last_name": "Williams", "email": "bob.w@example.com" },
        { "id": 203, "first_name": "Charlie", "last_name": "Brown", "email": "charlie.b@example.com" },
        { "id": 204, "first_name": "Diana", "last_name": "Miller", "email": "diana.m@example.com" },
        { "id": 205, "first_name": "Ethan", "last_name": "Davis", "email": "ethan.d@example.com" },
        { "id": 206, "first_name": "Fiona", "last_name": "Garcia", "email": "fiona.g@example.com" },
        { "id": 207, "first_name": "George", "last_name": "Rodriguez", "email": "george.r@example.com" },
        { "id": 208, "first_name": "Hannah", "last_name": "Wilson", "email": "hannah.w@example.com" },
        { "id": 209, "first_name": "Ian", "last_name": "Martinez", "email": "ian.m@example.com" },
        { "id": 210, "first_name": "Jane", "last_name": "Smith", "email": "jane.smith@example.com" },
      ]);

      // 3. Ingest Orders
      await API.post(`/ingest/tenant/${tenantId}/orders`, [
        { "id": 1001, "total_price": "100.00", "created_at": "2025-09-10T10:00:00Z", "customer": { "id": 201 }, "line_items": [{ "product_id": 101, "quantity": 1 }, { "product_id": 102, "quantity": 1 }] },
        { "id": 1002, "total_price": "50.00", "created_at": "2025-09-09T15:30:00Z", "customer": { "id": 202 }, "line_items": [{ "product_id": 101, "quantity": 2 }] },
        { "id": 1003, "total_price": "90.00", "created_at": "2025-09-08T11:00:00Z", "customer": { "id": 203 }, "line_items": [{ "product_id": 103, "quantity": 1 }, { "product_id": 104, "quantity": 1 }] },
        { "id": 1004, "total_price": "150.00", "created_at": "2025-09-07T18:45:00Z", "customer": { "id": 202 }, "line_items": [{ "product_id": 102, "quantity": 2 }] },
        { "id": 1005, "total_price": "80.00", "created_at": "2025-09-06T12:00:00Z", "customer": { "id": 204 }, "line_items": [{ "product_id": 105, "quantity": 1 }, { "product_id": 106, "quantity": 1 }] },
        { "id": 1006, "total_price": "25.00", "created_at": "2025-09-05T09:20:00Z", "customer": { "id": 205 }, "line_items": [{ "product_id": 101, "quantity": 1 }] },
        { "id": 1007, "total_price": "135.00", "created_at": "2025-09-04T14:55:00Z", "customer": { "id": 206 }, "line_items": [{ "product_id": 102, "quantity": 1 }, { "product_id": 105, "quantity": 1 }] },
        { "id": 1008, "total_price": "75.00", "created_at": "2025-09-03T20:10:00Z", "customer": { "id": 207 }, "line_items": [{ "product_id": 102, "quantity": 1 }] },
        { "id": 1009, "total_price": "115.00", "created_at": "2025-09-02T13:00:00Z", "customer": { "id": 201 }, "line_items": [{ "product_id": 104, "quantity": 1 }, { "product_id": 105, "quantity": 1 }] },
        { "id": 1010, "total_price": "40.00", "created_at": "2025-09-01T16:00:00Z", "customer": { "id": 208 }, "line_items": [{ "product_id": 106, "quantity": 2 }] },
        { "id": 1011, "total_price": "60.00", "created_at": "2025-08-31T10:00:00Z", "customer": { "id": 209 }, "line_items": [{ "product_id": 105, "quantity": 1 }] },
        { "id": 1012, "total_price": "55.00", "created_at": "2025-08-30T11:40:00Z", "customer": { "id": 210 }, "line_items": [{ "product_id": 104, "quantity": 1 }] },
        { "id": 1013, "total_price": "95.00", "created_at": "2025-08-29T17:00:00Z", "customer": { "id": 203 }, "line_items": [{ "product_id": 102, "quantity": 1 }, { "product_id": 106, "quantity": 1 }] },
        { "id": 1014, "total_price": "120.00", "created_at": "2025-08-28T19:00:00Z", "customer": { "id": 202 }, "line_items": [{ "product_id": 105, "quantity": 2 }] },
        { "id": 1015, "total_price": "35.00", "created_at": "2025-08-27T08:00:00Z", "customer": { "id": 201 }, "line_items": [{ "product_id": 103, "quantity": 1 }] },
      ]);

      // 4. Ingest Sample Events
      await API.post(`/ingest/tenant/${tenantId}/events`, [
        { "eventName": "checkout_started", "customerId": 201 },
        { "eventName": "checkout_started", "customerId": 202 },
        { "eventName": "checkout_started", "customerId": 203 },
        { "eventName": "checkout_started", "customerId": 204 },
        { "eventName": "checkout_started", "customerId": 205 },
        { "eventName": "checkout_started", "customerId": 206 },
        { "eventName": "checkout_started", "customerId": 207 },
        { "eventName": "cart_abandoned", "customerId": 208 },
        { "eventName": "cart_abandoned", "customerId": 209 },
        { "eventName": "cart_abandoned", "customerId": 210 },
      ]);

      await fetchData();
    } catch (err) {
      setError('Failed to ingest data. Please check the server logs.');
    } finally {
      setIngesting(false);
    }
  };

  const handleFilterOrders = async () => { /* ... (This function is unchanged) ... */ };

  if (loading) return <h2>Loading dashboard...</h2>;

  return (
    <div style={{ padding: '20px' }}>
      { /* ... (The rest of your page JSX is unchanged) ... */ }
    </div>
  );
}
